import { Link } from 'react-router-dom';
import { StyledNavLink } from '../../app-styled'; 

interface Link {
  isPrimary?:boolean,

}

const Header = ({isPrimary} : Labels) => {
  return(
    <header className="header"> 
      <nav>
        <Link className='nav-link' to="/"><StyledNavLink isPrimary={true} >Homepage</StyledNavLink></Link>
        <Link className="nav-link" to="/contact"><StyledNavLink>Navigation Two</StyledNavLink></Link>
        <Link className="nav-link" to="/content-page"><StyledNavLink>Navigation Two</StyledNavLink></Link>
      </nav>
    </header>
  );
}

export default Header;
